		var r = Wait();

		switch (r)
		{
			case "@c1":
				SubTalk(C1(c));
				break;
			case "@c2":
				SubTalk(C2(c));
				break;
			case "@c3":
				SubTalk(C3(c));
				break;
			case "@c4":
				SubTalk(C4(c));
				break;
		}

		End();
	}

